import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";

function HomeContent() {
  return (
    <Container fluid>
      <Row>
        <Link to="/films"><Col className="colFilms">FILMS</Col></Link>
        <Link to="/actors"><Col className="colActors">ACTORS</Col></Link>
      </Row>
    </Container>
  )
}

export default HomeContent;
